from collections import OrderedDict
class Solution:
    # @param {character[][]} board
    # @param {string[]} words
    # @return {string[]}
    def findWords(self, board, words):
        self.board = board
        self.trie = {}
        x = len(board)
        y = len(board[0])
#        self.total = x * y

        for word in words:
            trie_dict = self.trie
            for char in word:
                 trie_dict = trie_dict.setdefault(char, {})
            trie_dict['#'] = {}
        self.results = set()
        for i in xrange(len(board)):
            for j in xrange(len(board[0])):
                next_batch = [(OrderedDict({(i, j):0}), self.trie)]
                while next_batch:
                    new_batch = []
                    for node_trace, trie_hash in next_batch:
                        m, n = next(reversed(node_trace))
                        char = self.board[m][n]
                        if '#' in trie_hash:
                            string = ''.join([self.board[x1[0]][x1[1]] for x1 in node_trace.keys()[:-1]])
                            self.results.add(string)
                        if char in trie_hash:
                            for new_pos in ((m, n + 1), (m, n - 1), (m + 1, n), (m - 1, n)):
                                 if 0 <= new_pos[0] < x and 0 <= new_pos[1] < y and (new_pos not in node_trace):
                                    tmp = OrderedDict(node_trace)
                                    tmp[new_pos] = 0
                                    new_batch.append((tmp, trie_hash[char]))
                    next_batch = new_batch
                    #remaining -= 1
        return list(self.results)


